pragma solidity ^0.8.11;

import "hardhat/console.sol";

contract CrypToken {
	address public minter;

	mapping(uint256 => address) public tokenOwner;

	mapping(address => uint256) public ownedTokensBalance;

	mapping(address => uint256) private balances;

	event Bought(uint256 amount);
	event Sold(uint256 amount);
	event Transfer(address indexed from, address indexed to, uint256 value);

	uint256 totalSupply_ = 10 ether;

	constructor() {
		minter = msg.sender;
		balances[msg.sender] = totalSupply_;
	}

	function _exists(uint256 tokenId) public view returns (bool) {
		// address owner = tokenOwner[tokenId];
		// return owner != address(0);
		console.log("teste");
		address owner = tokenOwner[tokenId];
	}

	function mint(uint256 tokenId) public {
		require(!_exists(tokenId), "Error: Token ja existe");
		require(msg.sender == minter);

		tokenOwner[tokenId] = msg.sender;
		ownedTokensBalance[msg.sender] += 1;
	}

	function getBalance(address account) public view returns (uint256) {
		require(
			msg.sender == account || msg.sender == minter,
			"You cannot get a balance on someone else's account"
		);
		return balances[account];
	}

	function transfer(address receiver, uint256 numTokens)
		public
		returns (bool)
	{
		require(numTokens <= balances[msg.sender]);
		receiver.call{ value: numTokens };
		console.log("receiver", receiver);
		// balances[msg.sender] = balances[msg.sender] - numTokens;
		// balances[receiver] = balances[receiver] + numTokens;

		emit Transfer(msg.sender, receiver, numTokens);

		return true;
	}
}
